import React from 'react'

function option() {
  return (
    <div className="container mt-5">
                 <h3 className="mb-4"> Credit card payment</h3>
        <button onClick={() => navigate("/qpay")}>Qpay</button>
        <button onClick={() => navigate("/card")}>Cart</button>
    </div>
  )
}

export default option
